rf:\n    pperf.to_csv(fperf, encoding='utf-8', index=False)\n    \nwith open(\"diag.csv\", \"a\") as fdiag:\n    pdata.to_csv(fdiag, encoding='utf-8', index=False)\n    \nC.Finalization()\n    \n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"tools":[{"id":"1179"}]},"id":"1169","type":"Toolbar"},{"attributes":{"below":[{"id":"1084"}],"center":[{"id":"1087"},{"id":"1091"}],"left":[{"id":"1088"}],"renderers":[{"id":"1106"}],"sizing_mode":"stretch_both","title":{"id":"1415"},"toolbar":{"id":"1097"},"x_range":{"id":"1076"},"x_scale":{"id":"1080"},"y_range":{"id":"1078"},"y_scale":{"id":"1082"}},"id":"1075","subtype":"Figure","type":"Plot"},{"attributes":{"tools":[{"id":"1020"},{"id":"1021"},{"id":"1022"},{"id":"1023"},{"id":"1036"}]},"id":"1025","type":"Toolbar"},{"attributes":{},"id":"1482","type":"AllLabels"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"axis":{"id":"1048"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1051","type":"Grid"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1103","type":"Quad"},{"attributes":{"tabs":[{"id":"1402"},{"id":"1406"},{"id":"1409"},{"id":"1410"},{"id":"1403"},{"id":"1404"},{"id":"1405"},{"id":"1407"},{"id":"1408"}]},"id":"1411","type":"Tabs"},{"attributes":{},"id":"1080","type":"LinearScale"},{"attributes":{"coordinates":null,"formatter":{"id":"1318"},"group":null,"major_label_policy":{"id":"1319"},"ticker":{"id":"1293"}},"id":"1292","type":"DatetimeAxis"},{"attributes":{"dimensions":"width"},"id":"1302","type":"WheelZoomTool"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1550"},{"id":"1551"},{"id":"1552"},{"id":"1553"},{"id":"1554"},{"id":"1555"},{"id":"1556"},{"id":"1557"},{"id":"1558"},{"id":"1559"},{"id":"1560"},{"id":"1561"}
